    const [notes,setNotes] = useState
    function addNote(note) {
        console.log(note);
    }

    return (
        <div>
            <Header />
            <CreateNote onAdd={addNote}/>
            {notes.map(noteItem => (
                    <Note 
                        key={noteItem.key} 
                        title = {noteItem.title} 
                        content = {noteItem.content} 
                    />
            ))}
            <Footer />
        </div> 
    );
}

export default App;
